import React, { Component } from "react";

const MovieComponent = (props) => {
    console.log('passed json', props.moviedetails)

    return (
        <div id='movieComponentId'>
            <img src={props.moviedetails.Poster} />
            <p className="Title">{props.moviedetails.Title}</p>
            <label>About the moview</label>
            <p className="About">{props.moviedetails.Plot}</p>
            <hr></hr>
            <label>Cast</label>
            <p className="Cast">{props.moviedetails.Actors}</p>
        </div>
    )
}
export default MovieComponent;
